from meteostat import Point, Hourly
from datetime import datetime
import pandas as pd


def get_historical_weather(latitude, longitude, year, month, day, hour):
    # Create a Point for the location
    location = Point(latitude, longitude)

    # Define the start and end times (hourly data for the specified date and hour)
    start = datetime(year, month, day, hour)
    if hour != 23:
        end = datetime(year, month, day, hour + 1)
    else:
        start = datetime(year, month, day, hour-1)
        end = datetime(year, month, day, hour)

    data = Hourly(location, start, end)
    data = data.fetch()

    if data.empty:
        return None

    # Extract weather data from the DataFrame
    data = data.iloc[0][['temp', 'rhum', 'wspd']].tolist()
    return data

def day_of_year_to_date(day_of_year):
    if day_of_year < 1 or day_of_year > 365:
        return "Error: Please enter a number between 1 and 365."
    month_days = [
        (1, 31),   # January
        (2, 28),   # February
        (3, 31),   # March
        (4, 30),   # April
        (5, 31),   # May
        (6, 30),   # June
        (7, 31),   # July
        (8, 31),   # August
        (9, 30),   # September
        (10, 31),  # October
        (11, 30),  # November
        (12, 31)   # December
    ]

    month = 0
    for m, days in month_days:
        if day_of_year <= days:
            month = m
            day = day_of_year
            break
        day_of_year -= days

    return month, day

